# What is Data Science? Page
def data_science_info():
    st.title("What is Data Science?")
    st.markdown("""
    Data Science is an interdisciplinary field focused on extracting knowledge and insights from data. It integrates:
    - **Programming**: Python, R, SQL, etc.
    - **Mathematics and Statistics**: Probability, Linear Algebra, and Statistical Modeling.
    - **Domain Knowledge**: Industry-specific expertise to interpret data meaningfully.
    """)


    st.subheader("Key Areas in Data Science")
    areas = [
        {"title": "Machine Learning", "content": "Design algorithms that learn patterns and make predictions."},
        {"title": "Data Engineering", "content": "Build robust data pipelines to handle large volumes of data."},
        {"title": "Data Analysis", "content": "Identify trends, patterns, and insights in data."},
        {"title": "AI Research", "content": "Advance Artificial Intelligence and its applications."},
        {"title": "Visualization", "content": "Present data in a visually meaningful way using tools like Tableau or Power BI."}
    ]

    # Display Cards for Key Areas
    cols = st.columns(2)
    for i, area in enumerate(areas):
        with cols[i % 2]:
            st.markdown(f"""
            <div class="card">
                <h3>{area['title']}</h3>
                <p>{area['content']}</p>
            </div>
            """, unsafe_allow_html=True)

    st.markdown("""
        <style>
        .corner-image {
            position: absolute;
            top: 10px;
            right: 10px;
            width: 500px; /* Adjust the size of the image */
        </style>
        <div class="corner-image-container">
        <img src="data:image/jpeg;base64," class="corner-image">
        </div>
    """, unsafe_allow_html=True)

    # Roadmap to Becoming a Data Scientist
    st.subheader("Roadmap to Becoming a Data Scientist")
    roadmap = """
    1. **Learn the Basics**:
       - Programming (Python, R)
       - Mathematics (Statistics, Linear Algebra, Calculus)
    2. **Work on Real-World Projects**:
       - Data Cleaning and Exploration
       - Build predictive models
    3. **Develop Specialized Skills**:
       - Machine Learning, Deep Learning, NLP
    4. **Build a Portfolio**:
       - Share projects on GitHub
       - Create an online portfolio
    5. **Apply for Jobs**:
       - Focus on internships and entry-level roles
       - Leverage networking platforms like LinkedIn
    """
    st.markdown(roadmap)


# Expert Registration Page
def expert_registration():
    st.title("Expert Registration")
    st.markdown("### If you're an expert in Data Science, please fill out the form below:")

    name = st.text_input("Name")
    email = st.text_input("Email")
    expertise = st.text_input("Expertise")
    if st.button("Submit"):
        # Save data to CSV
        expert_data = {"Name": [name], "Email": [email], "Expertise": [expertise]}
        df = pd.DataFrame(expert_data)
        df.to_csv("experts.csv", mode="a", index=False, header=False)
        st.success("Your information has been saved. Thank you for registering as an expert!")


# Search for Experts Page
def search_expert():
    st.title("Search for Experts")
    st.markdown("### Find experts in Data Science by name or area of expertise:")

    # Load experts from CSV (if the file exists)
    try:
        df = pd.read_csv("experts.csv", header=None, names=["Name", "Email", "Expertise"])
    except FileNotFoundError:
        st.warning("No experts found. Please register an expert first.")
        return

    # Search functionality
    search_query = st.text_input("Enter name or expertise:")
    if search_query:
        results = df[
            df.apply(lambda row: search_query.lower() in row.astype(str).str.lower().values, axis=1)
        ]

        if not results.empty:
            st.markdown(f"### Found {len(results)} expert(s):")
            for _, row in results.iterrows():
                st.markdown(f"""
                <div class="card">
                    <h3>{row['Name']}</h3>
                    <p><strong>Email:</strong> {row['Email']}</p>
                    <p><strong>Expertise:</strong> {row['Expertise']}</p>
                </div>
                """, unsafe_allow_html=True)
        else:
            st.error("No experts found matching your search. Try another query.")


# Talk to an Expert Page
def talk_to_expert():
    st.title("Talk to an Expert")
    st.markdown("### Send your questions to an expert and receive guidance:")
    email = st.text_input("Your Email")
    message = st.text_area("Your Message")
    if st.button("Send Message"):
        st.success("Your message has been sent. We will connect you with an expert shortly.")


# Run the App
if __name__ == "__main__":
    main()
